import React from 'react'
// import logo from 'images/cross-logo.jpg'

export default function Navbar() {
  return (
    <div>
        <nav className='bg-white h-16  sticky top-0'>
            <ul className='flex justify-around text-black font-Syne font-bold text-xl	 '>
                <li ><a href="#" > <img src="images/haven-logo.jpg" alt="" /></a> </li>
                <li ><a href="#"> About</a> </li>
                <li ><a href="#"> Contact Us</a> </li>

            </ul>
        </nav>
    </div>
  )
}
